import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';

import Navbar from './Navbar';
import Tableuser from './table_user';
import Dashboard from './dashboard';
// นำเข้าคอมโพเนนต์ต่าง ๆ ที่ใช้เป็นหน้า

function App() {
  const isLoggedIn = true; // เปลี่ยนเป็นเงื่อนไขของการเช็คสถานะการเข้าสู่ระบบของคุณที่นี่

  return (
    <Router>
      {/* เริ่มต้นเป็นหน้า Dashboard หากเข้าสู่ระบบแล้ว */}
      {isLoggedIn && <Navigate to="/dashboard" />}

      {/* Navbar จะแสดงทุกหน้า */}

      <Routes>
        {/* กำหนดเส้นทางไปยังหน้า Tableuser */}
        <Route path="/table_user" element={<Tableuser />} />

        {/* กำหนดเส้นทางไปยังหน้า Dashboard */}
        <Route path="/dashboard" element={<Dashboard />} />

        {/* เพิ่ม Route อื่น ๆ ที่คุณต้องการให้แสดงตามที่คุณกำหนด */}
        {/* <Route path="/other-page" element={<OtherPageComponent />} /> */}
      </Routes>
    </Router>
  );
}

export default App;
